@vrikshitfoundation visits @dreamgirlfoundationngo and delightfully volunteer to provide kits for the students 💌 

We were honored to welcome the incredible team from Vrikshit Foundation to Dream Girl Foundation! Their visit and generous donation of kits to our students will go a long way in empowering them to pursue their dreams and aspirations. We are beyond grateful for the support and belief they’ve shown in our mission. 

Together, we’re building a brighter future, one student at a time. Thank you, Vrikshit Foundation, for making a difference! 💫 #CommunityUnity #EmpoweringTheFuture #DreamGirlFoundation #VrikshitFoundation #SupportingDreams”
